import React, { useState } from "react";
import { useGetMics } from "./useGetMics";

export const MicsPage = () => {
  const [micData, setMicData] = useState();

  useGetMics(setMicData);
  console.log(micData);

  return (
    <div className="mics__wrapper">
      <div className="title__container">
        <h1>MICS</h1>
      </div>
    </div>
  );
};
